import React from "react";
import Login from "./pages/Login";
import {  BrowserRouter, Route, Switch, Redirect} from "react-router-dom";


function App() {
  return (
     <BrowserRouter>
     <>
     <Switch>
      <Redirect  from ="/" to="/login/" exact />
      <Route  path="/login" to={Login} />
      <Route  path="/signup" to={null} />
      </Switch>
    </>
     </BrowserRouter>

  );
}

export default App;
